  <table cellpadding=0 cellspacing=0 width="100%">
   <tr>
    <td><![endif]>
    <div>
    <p class=MsoNormal style='line-height:normal'><span style='font-size:9.0pt;
    mso-bidi-font-size:11.0pt'>Valores<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:normal'><span style='font-size:9.0pt;
    mso-bidi-font-size:11.0pt'>Como principal valor se fomentará el RESPETO<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:normal'><span style='font-size:9.0pt;
    mso-bidi-font-size:11.0pt'>RESPETO a la naturaleza: Ecología<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:normal'><span style='font-size:9.0pt;
    mso-bidi-font-size:11.0pt'>RESPETO a la diversidad de formas de pensar y de
    ser: Tolerancia<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:normal'><span style='font-size:9.0pt;
    mso-bidi-font-size:11.0pt'>RESPETO al tiempo de los demás: Puntualidad<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:normal'><span style='font-size:9.0pt;
    mso-bidi-font-size:11.0pt'>RESPETO a la verdad: Honestidad<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:normal'><span style='font-size:9.0pt;
    mso-bidi-font-size:11.0pt'>RESPETO de género: Convivencia<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:normal'><span style='font-size:9.0pt;
    mso-bidi-font-size:11.0pt'>Nuestra Visión<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:normal'><span style='font-size:9.0pt;
    mso-bidi-font-size:11.0pt'>Ser una Institución de Bachillerato General con
    Alta Calidad Académica, capaz de impartir una formación integral con el
    propósito de transformar la sociedad basada en los valores, principios y
    calidez humana.<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:normal'><span style='font-size:9.0pt;
    mso-bidi-font-size:11.0pt'>Nuestra Misión<o:p></o:p></span></p>
    <p class=MsoNormal style='line-height:normal'><span style='font-size:9.0pt;
    mso-bidi-font-size:11.0pt'>Guiar a los Jóvenes en la construcción del
    conocimiento, comprometidos con los ideales de libertad y progreso en un
    marco de valores, con un sentido social, democrático y de Identidad
    Nacional, acorde con el desarrollo científico y tecnológico, buscando la
    formación integral del estudiante, así como su ingreso y permanencia en el
    Nivel Superior. <o:p></o:p></span></p>
    </div>
    <![if !mso]></td>
   </tr>
  </table>
  <![endif]></v:textbox>
